      SELECT DISTINCT - col0 / - + col0 + + 62 - - col2 + + 2 * - - col2 * + col1 + - - ( 51 ) * col1 * + col2 * col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
